// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

// install first: npm i @openzeppelin/contracts
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";


contract Cifar is ERC721, ERC721Enumerable, ERC721URIStorage, Ownable {
    using Counters for Counters.Counter;

    Counters.Counter private _tokenIdCounter;

    uint256 maxToken = 60;
    uint256 mintPrice = 0.0001 * 10 ** 18; // TODO: 0.0001 ETH -> 0.069 ETH
    uint256 maxMintableAtOnce = 3;
    uint256 startIndex = 5; // TODO: random value

    string PROVENANCE_HASH = "";
    string CONCAT_HASH_URI = "";

    constructor() ERC721("Cifar", "C") {}

    function mintCifar10(uint256 numberOfTokens) external payable {
        require(numberOfTokens <= maxMintableAtOnce, "Invalid amount to mint at once");
        require(totalSupply() + numberOfTokens <= maxToken, "Purchase would exceed max supply");
        require(mintPrice * numberOfTokens <= msg.value, "Ether value sent is not correct");
        //require(_tokenIdCounter.current() < maxToken);
        for(uint256 i = 0; i < numberOfTokens; i++) {
            if (totalSupply() < maxToken) {
                _safeMint(msg.sender, _tokenIdCounter.current());
                _tokenIdCounter.increment();
            }
        }
    }

    function _baseURI() internal pure override returns (string memory) {
        return "https://ipfs.io/ipfs/";
    }

    function _beforeTokenTransfer(address from, address to, uint256 tokenId)
        internal
        override(ERC721, ERC721Enumerable)
    {
        super._beforeTokenTransfer(from, to, tokenId);
    }

